import React from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';

export class App extends React.Component {
	constructor() {
		super();
		this.state = {
			sent: true,

		};
		this.submit2 = this.submit2.bind(this)
	}

	render() {
		return (this.state.sent ? this.servicesForm() : this.b());
	}

	submit(e) {
		e.preventDefault();
		this.setState({sent: false});
	}

	submit2(e) {
		console.log("submit2")
		e.preventDefault();
		const data = e.target.services
		console.log(data)
		const url = "http://localhost:3000/api/register";
		axios.post(url, data)
			.then(res => console.log(data))
			.catch(err => console.log(err.data))
	}

	servicesForm() {
		return (
		<form action="/results" method="POST" onSubmit={this.submit2}>
			<input name="services" type="checkbox" />
			<label>Service #1</label>
			<br />
			<input name="services" type="checkbox" />
            <label>Service #2</label>
            <br />
			<input name="services" type="checkbox" />
            <label>Service #3</label>
			<br />
			<input className="btn btn-primary" type="submit" onClick={(e) => this.submit(e)} />
			<br />
		</form>);
	}

	b() {
		return <div>Service request submitted.</div>;
	}
}

export default App;
